import { useRouter } from 'next/router'
import Layout from '../components/Layout'


const Content = () => {
	const router = useRouter();
	console.log(this.props)
   	return (
   		<div>
   			<h1>{router.query.UniqueMessageId}</h1>
			
   			<p>This is the blog post page from Youtube</p>
   		</div>
   	);
};

const Page = () => {
	return(
		<Layout>
			<Content />
		</Layout>
	);
};

export default Page
